import ExpenseItem from "./components/ExpenseItem";
import "./Expenses.css";

function Expenses(props) {
  return (
    <div className="expenses">
      {props.Expenses.array.forEach((element) => {
        <ExpenseItem
          title={element.title}
          amount={element.amount}
          date={element.date}
        />;
      })}
    </div>
  );
}
export default Expenses;
